import React from 'react';

const ManageVenues = () => {
  return (
    <div>
      <h1>Manage Venues Page</h1>
      <p>This page will be used for managing venue listings (e.g., by vendors or admins).</p>
    </div>
  );
};

export default ManageVenues;
